import axios from "axios"

export const createCena = (cena) =>{
    return (dispatch, getState) =>{
        //async call to db dodavanje u bazu
        axios.get('http://localhost:8092/api/hotel/hoteskaSoba/'+cena.sobaID)
            .then(res => {
                axios.post('http://localhost:8092/api/hotel/cene/', { cena: cena.cenaSobeDodaj, datumOd: cena.vaziOdDodaj, datumDo: cena.vaziDoDodaj, hotelskaSoba_cena: res.data })
                    .then(res => {
                    console.log(res);
                    //console.log(res.data);
                })
        })
        dispatch({type: 'CREATE_CENA', cena: cena});
    }

}
